// File: Xirtam_Token.sol

//SPDX-License-Identifier: MIT

pragma solidity 0.8.19;

//interfaces
interface IPancakeV2Factory {
    function createPair(address tokenA, address tokenB)
        external
        returns (address pair);
}

interface IPancakeV2Router02 {
    function factory() external pure returns (address);

    function WETH() external pure returns (address);

    function swapExactTokensForETHSupportingFeeOnTransferTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external;
}

contract XIRTAM is ERC20, Ownable { // here we use the Ownable library, which is used to make certain functions only usable for the contract owner.
    IPancakeV2Router02 public pancakeV2Router; // router to swap the fees into ETH before sending them to the fee receiver.
    bool private isInternalTransaction; // a boolean is a variable that can either be true or false, and we use this to determine if a transaction is internal or external.
    address public marketingAddress; // address that all fees go to (in ETH).
    address public pancakeV2Pair; // the pancakeV2Pair is the pair between XIRTAM and ETH that is created upon launch, when adding liquidity.
    uint256 public fee; // the variable to determine the fee, which is a fixed 2.5% on buys and sells.
    uint256 public minimumTokensBeforeSwap; // the minimum amount of XIRTAM tokens the contract has before it does a sell to send to the fee receiver.

    mapping(address => bool) public excludedFromFees; // we use this mapping to exclude contract address, fee receiver address and the owner from fees.
    mapping(address => bool) public automatedMarketMakerPairs; // in case we want XIRTAM to be traded on multiple DEX, we add the new DEX pair to this mapping.

    constructor() ERC20("XIRTAM", "XIRTAM") { // declaring the name and symbol for XIRTAM token.
        uint256 total_supply = 1000000000 * 10**decimals(); // total supply is the only time tokens will be minted, and is 1 BILLION (1,000,000,000).
        IPancakeV2Router02 _pancakeV2Router = IPancakeV2Router02(
            0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D  // router for uniswap.
        );
        pancakeV2Router = _pancakeV2Router; // the uniswap and pancakeswap is almost identical, so even though we use the one that is called pancakeV2Router, it works perfectly for uniswap.
        pancakeV2Pair = IPancakeV2Factory(_pancakeV2Router.factory())
            .createPair(address(this), _pancakeV2Router.WETH()); // creates pair between XIRTAM and ETH.

        marketingAddress = address(0x5Dd84da136AC356C3c6461966CdE69a7BFA482E0);
        fee = 25; // sets fee to 2.5%. 1000 = 100%, so 25 = 2.5%.
        minimumTokensBeforeSwap = 100000 * 10**decimals(); // sets the minimum tokens before a swap to 100,000 tokens.

        excludedFromFees[address(this)] = true; // excludes contract address from fees.
        excludedFromFees[owner()] = true;  // excludes owner from fees.
        excludedFromFees[marketingAddress] = true;  // excludes fee receiver from fees.

        automatedMarketMakerPairs[pancakeV2Pair] = true;
        _mint(owner(), total_supply); // mints the total supply to the owner. the first and last time that tokens will be minted.
    }

    // accept bnb for autoswap
    receive() external payable {}

    function decimals() public pure override returns (uint8) {
        return 18;
    }

    // burn function
    function burn(uint256 amount) public {
        _burn(_msgSender(), amount); // enables the ability to burn tokens for events and such.
    }

    function setFeesAddress(address marketing) external onlyOwner { // allows us to change the fee receiving address.
        marketingAddress = marketing;
    }

    function setFees(uint256 _fee) external onlyOwner { // allows us to change the fees.
        require(_fee <= 25, "Fee cannot be above 2.5%");
        fee = _fee;
    }

    function setFeesExclusion(address _target, bool _status) // allows us to exclude other addresses from fees.
        external
        onlyOwner
    {
        excludedFromFees[_target] = _status;
    }

    function editMarketMakerPair(address _pair, bool _flag) external onlyOwner { // allows us to add additional pairs in case we list on a new DEX.
        automatedMarketMakerPairs[_pair] = _flag;
    }

    function swapTokensForEth(uint256 tokenAmount) private { // functionality to swap the tokens accumulated from fees into ETH.
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = pancakeV2Router.WETH();
        _approve(address(this), address(pancakeV2Router), tokenAmount);
        pancakeV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            marketingAddress,
            block.timestamp
        );
    }

    function swapTokens() private { // the actual function we use to swap tokens into ETH.
        uint256 contractTokenBalance = balanceOf(address(this));
        isInternalTransaction = true;
        swapTokensForEth(contractTokenBalance);
        isInternalTransaction = false;
    }

    // transfer function, this contains all rules, paramters and functionality that happens when either transferring between addresses, buying or selling.
    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        uint256 trade_type = 0;
        // normal transaction ( address to address )
        if (!isInternalTransaction) {
            //buy
            if (automatedMarketMakerPairs[from]) {
                trade_type = 1;
            }
            //sell
            else if (automatedMarketMakerPairs[to]) {
                trade_type = 2;
                bool overMinimumTokenBalance = balanceOf(address(this)) >=
                    minimumTokensBeforeSwap;
                // marketing auto-bnb
                if (overMinimumTokenBalance) {
                    swapTokens();
                }
            }

            // buy ( address to pair )
            uint256 txFees;
            if (trade_type == 1 && !excludedFromFees[to]) {
                txFees = (amount * fee) / 1000;
                amount -= txFees;
                super._transfer(from, address(this), txFees);
            }
            //sell ( pair to address)
            else if (trade_type == 2 && !excludedFromFees[from]) {
                txFees = (amount * fee) / 1000;
                amount -= txFees;
                super._transfer(from, address(this), txFees);
            }
        }
        // transfer tokens
        super._transfer(from, to, amount);
    }
}
